description:
Diện tích: ~100m²/tầng tổng 5 tầng.<br>Thiết kế: 7 phòng ngủ, 6 WC, giếng trời, ban công/logia tại mỗi tầng.<br>Không gian thoáng sáng tự nhiên, cửa kính lớn, giếng trời xuyên tầng.<br>Lối vào xanh mát với sân vườn, bể cá cảnh tạo cảm giác thư thái từ cửa nhà.<br>Ngõ lớn ô tô 2 chiều giao thông thuận tiện (gần Lăng Bác, Lottemart, Đại sứ quán, Kim Mã, Hoàng Hoa Thám...
).<br>Tầng 1: Sảnh rộng làm lễ tân/tiếp khách, để xe máy tiện lợi.<br>Nội thất: Điều hoà, nóng lạnh.<br>Phù hợp làm:<br>Spa, thẩm mỹ viện, cafe.<br>Văn phòng đại diện, công ty kinh doanh online.<br>Studio sáng tạo, showroom, không gian kết hợp ở và làm việc.<br>Giá thuê: 33 triệu/tháng.<br>
